contract LetsGoBro is Context, IERC20, Ownable{
    using SafeMath for uint256;
    using Address for address;

    string private _name = "Let's Go Bro";
    string private _symbol = "LGB";
    uint8 private _decimals = 18;
    uint256 private _totalSupply = 3 * 10**6 * 10 ** _decimals;

    uint8 private _sellLiquidityFee = 1;
    uint8 private _marketingFee = 1;
    uint8 private _marketRewardFee = 1;
    bool public isAddedFluidity = false;

    address payable private marketingWalletAddress = payable(0x990A4496b8D3bB977836aCd47BA957Da1ABf5a76);
    address payable private marketRewardWalletAddress = payable(0x011DE3428434C0AdCb15C79E3Aabb1Ff9CD8D060);

    mapping (address => mapping (address => uint256)) private _allowances;
    mapping (address => uint256) _balances;
    mapping (address => bool) public isMarketPair;

    IUniswapV2Router02 public uniswapV2Router = IUniswapV2Router02(0xF29acE1FE5f36389d0dDe450a0195A30c3770245);
    address public USDT = (0x55d398326f99059fF775485246999027B3197955);
    address public uniswapPair;

    constructor (string memory name_,string memory symbol_,address USDT_){
        _name = name_;
        _symbol = symbol_;
        USDT = USDT_;
        uniswapPair = IUniswapV2Factory(uniswapV2Router.factory())
            .createPair(address(this), USDT);
        isMarketPair[address(uniswapPair)] = true;
        _balances[_msgSender()] = _totalSupply;
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function getSellLiquidityFee() public view returns(uint8){
        return _sellLiquidityFee;
    }

    function getMarketingFee () public view returns (uint8){
        return _marketingFee;
    }

    function getMarketRewardFee () public view returns (uint8){
        return _marketRewardFee;
    }

    function setSellLiquidityFee(uint8 amount) public onlyOwner{
        _sellLiquidityFee = amount;
    }

    function setMarketingFee(uint8 amount) public onlyOwner{
        _marketingFee = amount;
    }

    function setMarketRewardFee(uint8 amount) public onlyOwner{
        _marketRewardFee = amount;
    }

    function balanceOf(address account) public view override  returns (uint256) {
        return _balances[account];
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function setIsMarketPair(address account, bool newValue) public onlyOwner {
        isMarketPair[account] = newValue;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) private returns (bool) {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        if(isMarketPair[sender] || isMarketPair[recipient]){
            if(sender != owner()){
                require(isAddedFluidity,"There is no added liquidity!");
            }
            else{
                isAddedFluidity = true;
            }
            if(sender != owner() && recipient != owner()){
                amount = takeFee(sender,amount);
            }
        }
        _basicTransfer(sender,recipient,amount);
        return true;
    }

    function takeFee (address sender,uint256 amount) internal returns (uint256) {
        uint256 sellLiquidityFee = amount.mul(_sellLiquidityFee).div(100);
        uint256 marketingFee = amount.mul(_marketingFee).div(100);
        _balances[marketingWalletAddress] = _balances[marketingWalletAddress].add(marketingFee);
        emit Transfer(sender, marketingWalletAddress, marketingFee);
        uint256 marketRewardFee = amount.mul(_marketRewardFee).div(100);
        _balances[marketRewardWalletAddress] = _balances[marketRewardWalletAddress].add(marketRewardFee);
        emit Transfer(sender, marketRewardWalletAddress, marketRewardFee);
        return amount.sub(sellLiquidityFee).sub(marketingFee).sub(marketRewardFee);
    }

    function _basicTransfer(address sender, address recipient, uint256 amount) internal returns (bool) {
        _balances[sender] = _balances[sender].sub(amount, "Insufficient Balance");
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

